u64 tohop(int a,int b) { 
  static u64 cache[68][35]={{1}}; 
  if (a<0 || a>67) return (u64)-1; 
  if (b<0 || b>a) return 0; 
  if (b<a-b) b=a-b; 
  u64 &r= cache[a][b]; 
  if (r) return r; 
  return r=tohop(a-1,b-1)+tohop(a-1,b); 
} 
 
